import React from 'react'
import { useState, useEffect } from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import {useSelector, useDispatch} from 'react-redux';
import { Button, Form , Card} from "react-bootstrap";
import API from "./APL";
import './session.css';
import {  Modal } from 'react-bootstrap';
import moment from 'moment';


const Sesion = () => {
  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("")
  const [date, setDate] = useState("");
  const [time, setTime] = useState("");
  const [link, setLink] = useState("");

  const [sessionId, setSessionId] = useState(null);
  const [sessions, setSessions] = useState([]);

  const auth= useSelector((state) => state.auth)
  const dispatch=useDispatch()
  console.log(auth);

  useEffect(() => {
    refreshSessions();
  }, []);

  const refreshSessions = () => {
    API.get("/")
      .then((res) => {
        setSessions(res.data);
      })
      .catch(console.error);
  };

  const onSubmit = (e) => {
    e.preventDefault();
    // e.target.reset();
    let item = { title, description, date, time, link };
    API.post("/", item).then(() => refreshSessions());
    setTitle("")
    setDescription("")
    setDate("")
    setTime("")
    setLink("")
  };

  const onUpdate = (id) => {
    let item = { title, description, date, time, link };
    API.patch(`/${id}/`, item).then((res) => refreshSessions());
    setTitle("")
    setDescription("")
    setDate("")
    setTime("")
    setLink("")
  }
  const onDelete = (id) => {
    API.delete(`/${id}/`).then((res) => refreshSessions());
  };
  function selectSession(id) {
    let item = sessions.filter((session) => session.id === id)[0];
    setTitle(item.title);
    setDescription(item.description);
    setDate(item.date);
    setTime(item.time);
    setLink(item.link);
    setSessionId(item.id);
  }
  const [isOpen, setIsOpen] = React.useState(false);
  const showModal = () => {
    setIsOpen(true);
  };
  const hideModal = () => {
    setIsOpen(false);
  };


  return (
    <div>
        <div className="container mt-5">
      <div className="row">

        <div className="col-md-8 mt-5">
          <h3 className="float-left mt-4">Available Sessions </h3>
          {/* <div className="row"> */}
          {/* <table class="table mt-4">
            <thead>
              <tr>
                <th scope="col"></th>
                <th scope="col">Title</th>
                <th scope="col">Session Details</th>
                <th scope="col">Session Date</th>
                <th scope="col">Time</th>
                <th scope="col">Session Link</th>
              </tr>
            </thead>
            <tbody> */}
              {sessions.map((session, index) => {

                return (


                  <>
                  {/* <tr key="">
                    <th scope="row">{session.id}</th>
                    <td> {session.title}</td>
                    <td>{session.description}</td>
                    <td>{session.date}</td>
                    <td>{session.time}</td>
                    <td>{session.link}</td>







                    <td>
                      {auth.isStudent ? null : <>
                        <Button
                          variant="secondary"
                          type="button"
                          onClick={() => selectSession(session.id)}
                          className="mx-2"
                        >
                          Edit
                        </Button>
                        <Button
                          variant="danger"
                          type="button"
                          onClick={() => onDelete(session.id)}
                          className="mx-2"
                        >
                          Delete
                        </Button>
                      </>}

                    </td>
                  </tr> */}
                  <div className="col-md-6 mt-3">
                  <Card className="text-center card m-2">
                    <Card.Header>{session.title}</Card.Header>
                    <Card.Body>
                      <Card.Title>Session Details</Card.Title>
                      <Card.Text className='des'> {session.description} </Card.Text><br/>
                      <h4>Date</h4>
                      <Card.Subtitle > {moment(session.date).utc().format('YYYY-MM-DD')} from, {session.time}</Card.Subtitle><br/>
                      <h4>Time</h4>
                      <a className="btn btn-primary" href="{session.link}">Join Session</a>
                      {/* <Button variant="primary">Go somewhere</Button> */}
                    </Card.Body>
                    <Card.Footer className="bg-default ">
                    {auth.isStudent ? null : <>
                        <Button
                          variant="secondary"
                          type="button"
                          onClick={() => selectSession(session.id)}
                          className="mx-2"
                        >
                          Edit
                        </Button>
                        <Button
                          variant="danger"
                          type="button"
                          onClick={() => onDelete(session.id)}
                          className="mx-2"
                        >
                          Delete
                        </Button>
                      </>}
                    </Card.Footer>
                  </Card>
                  </div>
                    </>
                );

              })}
            {/* </tbody>
          </table> */}
        </div>
      </div>
      </div>
    </div>
    // </div>
  )
}

export default Sesion
